ventana = tk.Tk()
ventana.title("Promesario")
ventana.geometry("400x250")
ventana.resizable(False, False)

# Creamos el estilo de ttk y lo configuramos con una paleta de colores moderna
estilo = ttk.Style()
estilo.theme_use('clam')
estilo.configure('Boton.TButton', foreground='#FFFFFF', background='#3F51B5', borderwidth=0, padding=5)
estilo.configure('Etiqueta.TLabel', font=('Arial', 13), foreground='#3F51B5')

etiqueta_promesa = ttk.Label(ventana, text="", wraplength=350, justify="center", style='Etiqueta.TLabel')
etiqueta_promesa.pack(pady=30)

# Cargamos el botón
boton_siguiente = ttk.Button(ventana, text="Siguiente Promesa", command=mostrar_promesa, style='Boton.TButton')
boton_siguiente.place(x=150, y=150)

# Mostramos el logo en la esquina inferior izquierda
imagen_base64 = "data:image/png;base64,"
datos_imagen = base64.b64decode(imagen_base64.split(',')[1])
img = Image.open(io.BytesIO(datos_imagen))
img = img.resize((70, 84), Image.LANCZOS)
foto = ImageTk.PhotoImage(img)
label_logo = tk.Label(ventana, image=foto, bg="#F0F0F0")
label_logo.place(x=30, y=150)

# Mostramos el copyright en el footer
etiqueta_copyright = ttk.Label(ventana, text="Olas © 2023", style='Etiqueta.TLabel')
etiqueta_copyright.place(x=300, y=220)

mostrar_promesa()
ventana.mainloop()